import React from "react";
import BookIcon from '@material-ui/icons/Book';
import Search from "./Search";


function Header() {
  return (
    <header>
      <h1>
        <BookIcon />
        Keeper
      </h1>
      <Search />
    </header>
  );
}

export default Header;
